import logo from './logo.svg';
import './App.css';
import Box from '@material-ui/core/Box';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >

          Learn React
          <div><Box color="red" bgcolor="palevioletred" p={1}>
      Greetings from VSC
    </Box></div>
    render(
  <Wrapper>
    <Title>
      Hello World!
    </Title>
  </Wrapper>
);

        </a>
      </header>
    </div>
  );
}

export default App;
